import React from "react";
import GeneralInfoImg from "./../../assets/img/general-info.png";

const GeneralInfo = () => {
  return (
    <section className="section-general-info">
      <div className="general-info">
        <div className="general-info-text-box">
          <h1 className="heading-primary">Order Food You Love</h1>
          <p className="general-info-description">
            Foodly allows you to order ahead of time & skip the line when
            picking up your food. We also offer delivery for selected
            participating restaurants. Our platform currently covers the Greater
            Vancouver area in British Columbia, Canada.
          </p>
        </div>
        <div className="general-info-img-box">
          <img src={GeneralInfoImg} alt="Drinks and meals" />
        </div>
      </div>
    </section>
  );
};

export default GeneralInfo;
